import './Start.css';
import {useNavigate} from 'react-router-dom'

const 
    history=useNavigate();

const click=()=>{
    history('/Signup')
}
function Start() {

    return (
        <>
        <h1>Payroll Management System</h1>
        <button onClick={click}>Employee Login</button>
            
        </>
    );
}

export default Start;
